"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[603],{22695:e=>{e.exports=JSON.parse('{"functions":[{"name":"GetLibrary","desc":"Returns an initialized [Library].\\n\\t","params":[{"name":"LibraryName","desc":"","lua_type":"string"}],"returns":[{"desc":"","lua_type":"Library\\r\\n"}],"function_type":"method","source":{"line":64,"path":"src/Script/StardustFramework/Libraries/init.lua"}}],"properties":[],"types":[{"name":"Library","desc":"A library is any ModuleScript with the [LibraryAPI] as its parent.\\nThe contents returned by this ModuleScript will be the contents made\\navailable by [`LibraryAPI:GetLibrary(LibraryName)`](LibraryAPI#GetLibrary).\\nA collection of functions that is intended to be used in other scripts/modules.\\nIntended to not be constantly active.","lua_type":"{[string]: (...any) -> (...any?);}","source":{"line":22,"path":"src/Script/StardustFramework/Libraries/init.lua"}}],"name":"LibraryAPI","desc":"The first drafted and published service that initializes every library so they can be accessible to other services.\\n\\nTo create a library, the following should be kept in mind:\\n- A new library\'s module is expected to return a table of functions that can be used by other systems.\\n- The library should be able to function by itself. Any dependancies of the library should not involve other external libraries.\\n- If there are any dependancies or \\"sub-libraries\\", then they could be directly required within the root of the library. This is becaues the LibraryAPI *only* requires the root of the library, and none of the descendants.\\n- The library should refrain from modifying data outside of itself to prevent unexpected data-structure changes. Any unique data should be managed and stored within the library.\\n\\nRefer to the [Development Workflow](../docs/Development%20Workflow/) document for more information","source":{"line":13,"path":"src/Script/StardustFramework/Libraries/init.lua"}}')}}]);